import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButtons, IonButton, IonIcon, IonMenuButton, IonBackButton } from '@ionic/react';
import React from 'react';
import QRComponent from '../components/QRComponent';
import './QRPage.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>


        <IonToolbar>
          <IonButtons slot="start">
            <IonMenuButton autoHide={false} color="primary" />
          </IonButtons>
          <IonButtons slot="secondary">
            <IonButton>
              <IonIcon slot="icon-only" name="star" />
            </IonButton>
          </IonButtons>
          <IonTitle slot="secondary">Left side menu toggle</IonTitle>
        </IonToolbar>

      </IonHeader>
      <IonContent>
        <QRComponent />
      </IonContent>
    </IonPage>
  );
};

export default Home;
